INSERT INTO `policies` (`id`, `policyheading`, `policycontent`, `created_at`, `updated_at`) VALUES
(23, 'General Code of Conduct', '<p>Employees are expected to maintain the highest standards of conduct and integrity in the performance of their duties and responsibilities. An employee who fails to conform to a reasonable standard of professional and personal behavior in carrying out assigned duties or who has a disregard for laws, rules, or regulations will face stringent disciplinary action.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp; It is the duty of each employee to:</p>\r\n<ul>\r\n<li>Respect the nature of privileged or confidential information regarding<strong>&nbsp;Siliconreview Technologies India Pvt. Ltd&nbsp;</strong>, its officers, board or staff;</li>\r\n<li>Not use information obtained in the conduct of&nbsp;<strong>Siliconreview Technologies India Pvt. Ltd.&rsquo;s</strong>&nbsp;business for personal or business advantage;</li>\r\n<li>Be certain that a position held with&nbsp;<strong>Siliconreview Technologies India Pvt. Ltd</strong> is never used to obtain unauthorized, illegal or questionable benefit as it would apply to a contractor, supplier or other party doing business with the Company.</li>\r\n</ul>\r\n<p><strong><u>General Rules</u></strong></p>\r\n<ul>\r\n<li>Always wear ID cards once you get inside the office premises. This is mandatory for us to stop any unauthorized person trying to access our workplace.</li>\r\n<li>Step out from the office in case of any emergency calls</li>\r\n<li>Employees need to ensure they send daily reports to their managers before logging out</li>\r\n<li>Use Intercom (phone) for communicating with each other within the organization</li>\r\n<li>Loss of ID cards and access cards would attract a penalty of Rs. 1000 from the employee. Please take care of it.</li>\r\n<li>While applying for a leave, draft an email to the manager as Well As HR</li>\r\n<li>Avoid eatables and mobile phone inside the office premises, to keep your workplace clean and productive</li>\r\n</ul>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><strong>A manager has the authority to make reasonable requests of employees to comply with the policy.<br /><br /><br /><br /></strong></p>', '2024-05-10 22:55:03', '2024-05-10 22:59:24'),
(25, 'Work Performance', '<ul>\r\n<li>Disobedience, or failure or refusal to carry out assignments or instructions.</li>\r\n<li>Loafing, loitering, sleeping or engaging in unauthorized personal business.</li>\r\n<li>Unauthorized disclosure of confidential information or records.</li>\r\n<li>Falsifying records or giving false information to other state agencies or to employees responsible for record keeping.</li>\r\n<li>Negligence in performance of assigned duties.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>All the above mentioned violations shall attract strict disciplinary action.</strong></p>', '2024-05-10 23:04:04', '2024-05-10 23:04:33'),
(26, 'Attendance and Punctuality', '<ul>\r\n<li>Failure to report promptly at the starting time of a shift or leaving before the scheduled quitting time of a shift without the specific approval of the supervisor.</li>\r\n<li>Failure to mark your attendance on daily basis on HR Soft portal</li>\r\n<li>Unexcused or excessive absenteeism.</li>\r\n<li>Failure to observe the time limits and scheduling of lunch, tea break or wash-up periods.</li>\r\n<li>Failure to notify the reporting manager promptly of unanticipated absence or tardiness.</li>\r\n</ul>\r\n<p><span style=\"font-family: Tahoma;\">Employee attendance will be based on the HR soft until the bio-metric is configured with the new software.</span></p>\r\n<p><strong>All the above mentioned violations shall attract strict disciplinary action.</strong></p>', '2024-05-10 23:05:12', '2024-08-27 19:35:19'),
(27, 'Personal Actions And Appearance', '<p>&bull; &nbsp; &nbsp;Threatening, attempting, or doing bodily harm to another person.&nbsp;<br />&bull; &nbsp; &nbsp;Threatening, intimidating, interfering with, or using abusive language towards others.&nbsp;<br />&bull; &nbsp; &nbsp;Unauthorized possession of weapons.&nbsp;<br />&bull; &nbsp; &nbsp;Making false or malicious statements concerning other employees or supervisors of the Siliconreview Technologies India Pvt. Ltd&nbsp;<br />&bull; &nbsp; &nbsp;Reporting for work under the influence of alcoholic beverages or illegal drugs.&nbsp;<br />&bull; &nbsp; &nbsp;Unauthorized solicitation for any purpose.&nbsp;<br />&bull; &nbsp; &nbsp;Frequent use of social media (Facebook, Instagram, Gtalk, Whatsapp etc.) during working hours and willful negligence of work in the process&nbsp;<br />&bull; &nbsp; &nbsp;Inappropriate dress or lack of personal hygiene that adversely affects proper performance of duties or constitutes a health or safety hazard&nbsp;<br />&bull; &nbsp; &nbsp;Unauthorized or improper use or possession of uniforms, identification cards, badges, or permits&nbsp;<br />&bull; &nbsp; &nbsp;Failure to exercise good judgment, or being discourteous, in dealing with fellow employees.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Violations of these rules can result in appropriate disciplinary action.</strong></p>\r\n<p><br /><br /></p>\r\n<p><strong><u>Dress Code and Personal Appearance</u></strong><u>:</u></p>\r\n<ul>\r\n<li>Employees are expected to reflect a favorable image by appropriate dress and hygiene.</li>\r\n<li>Moderation and common sense should be used in all these matters to assure the employee is suitable for work and the respective work environment.</li>\r\n</ul>', '2024-05-10 23:45:13', '2024-05-11 01:17:04'),
(28, 'Use of Property', '<ul>\r\n<li>Unauthorized or improper use of <strong>Apsensys\' </strong>property or equipment, including vehicles, telephone or mail service.</li>\r\n<li>Unauthorized posting or removal of notices or signs from bulletin boards.</li>\r\n<li>Unauthorized use, lending, borrowing or duplicating of Company</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>All the above mentioned violations shall attract strict disciplinary action.</strong></p>', '2024-05-10 23:50:36', '2024-05-11 01:16:03'),
(29, 'Misconduct', '<p>The following are considered acts of misconduct and the employees will face strict disciplinary action if found indulging in any of the following:</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Willful insubordination or disobedience, whether alone or in combination with others to any of the lawful and reasonable order or orders of the superiors.</li>\r\n<li>Theft, fraud or misappropriation of company\'s funds dishonesty in connection with the employer\'s business or property.</li>\r\n<li>Theft of property of another employee within the premises of the company.</li>\r\n<li>Willful damage to or loss of <strong>Apsensys</strong>&rsquo; goods or property.</li>\r\n<li>Taking or giving of any illegal gratifications.</li>\r\n<li>Habitual late attendance or late attendance on more than 3 occasions in a month.</li>\r\n<li>Misbehavior towards clients and visitors.</li>\r\n<li>Tampering with any records, evidence, threatening the witnesses, falsifying or refusing to give testimony when incidents in the undertaking or other matters are being investigated or being considered.</li>\r\n<li>False statements made or particulars given in his application form for appointment or when called upon by the management to make true statements of any fact in connection with any matter connected with the work or business of the company.</li>\r\n<li>Sleeping while on duty.</li>\r\n<li>Conviction for any offence by a court of law, involving moral turpitude.</li>\r\n<li>Obtaining leave on being sick and during the same period working elsewhere or attempting to obtain work elsewhere or obtain leave on false pretext.</li>\r\n<li>Refusal to submit for search or search on suspicion of theft of company\'s property.</li>\r\n<li>Collection of any money within the premises for purpose not sanctioned by the management.</li>\r\n<li>Refusal to work overtime due to exigencies of work.</li>\r\n<li>Unauthorized disclosure, to any person, of any information with regard to the process of the company, which may come in the possession of employee in the course of his work.</li>\r\n<li>Refusal to submit for medical examination when directed to do so by the manager.</li>\r\n<li>Logging attendance of any other employee or to falsify the records in any manner in respect of attendance.</li>\r\n<li>Failure to notify the company of change of address.</li>\r\n<li>Doing any act prejudicial to the interest of reputation of the company.</li>\r\n<li>Money lending or borrowing or running a chit funds scheme or engaging any kind of such trade within the premises of the company</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>All the above mentioned violations shall attract strict disciplinary action</strong></p>', '2024-05-10 23:51:18', '2024-05-11 01:15:43'),
(30, 'Public Holidays', '<p>The company grants 10 festive/public holidays to its employees in a year coinciding with different religious and important days of the country.</p>\r\n<p>Details will be conveyed to all employees in the beginning of new calendar year and will be effective from January 1<sup>st</sup>&nbsp;of every year.</p>', '2024-05-10 23:51:54', '2024-05-10 23:52:10'),
(31, 'Leave Policy', '<p>Company permits its employees to take leaves for various reasons, subject to business exigencies, as per the following details:</p>\r\n<p>Leaves becomes due to an employee only after completion of Training Period. Any leave beyond 2/3 days should be sanctioned at least one week before proceeding on the leaves.</p>\r\n<p>If any employee goes out of the station to avail his/her leave, contact details should be furnished in the leave application to his/her specific department/Administration</p>\r\n<p>Employee going on leave without intimation will be considered to be absent without pay/duty and can be terminated from his/her services, in case of prolonged absence.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>New Joiner/Confirmed Employee Leave Allotment:</strong></p>\r\n<p>A new joiner in the organization shall be entitled for a designation of a Trainee or a Probationary officer for a period of 6 months from the date of joining. After the completion of 6 months, the employee performance shall be evaluated for a permanent position in the organization.</p>\r\n<p>After the completion of the training period a permanent employee is entitled to a total of <strong>20 leaves/ annum.</strong></p>\r\n<p><strong><u>However, employees can only avail 10 leaves in the first half of the year.</u></strong>&nbsp;The remaining&nbsp;<strong>10 leaves</strong>&nbsp;shall be credited to the employee&rsquo;s account only from the&nbsp;<strong>month of July</strong>&nbsp;every year. Any additional leaves availed by an employee than the leaves credited in his or her account shall be considered as a Loss of Pay (LOP).</p>\r\n<p>If an employee does not avail the allotted leaves in the first half of the year,&nbsp;<strong>those leaves shall be carried forward in the second half of the same year.&nbsp;</strong>However, if an employee does not utilize any leaves for an entire year, it shall lapse in the beginning of the next year.&nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>After the completion of the training period in the first year (the year when the employee joins), the employees are entitled to the leaves as per the table below (Total leaves of an employee on completion of the training period, are credited as per the month of employee confirmation.&nbsp;</p>\r\n<ul>\r\n<li>Leaves will be credited on the basis of an employee getting permanent on&nbsp; particular month<img src=\"C:\\Users\\Apsensys HR\\Downloads\" alt=\"\" /></li>\r\n</ul>\r\n<table style=\"border-collapse: collapse; width: 62.4073%; height: 249.515px;\" border=\"1\">\r\n<tbody>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"width: 50%; height: 22.3906px;\">Jan to June</td>\r\n<td style=\"width: 50%; height: 22.3906px;\">July to Dec</td>\r\n</tr>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"width: 50%; height: 22.3906px;\">Jan - 10 leaves</td>\r\n<td style=\"width: 50%; height: 22.3906px;\">July - 10 Leaves</td>\r\n</tr>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"width: 50%; height: 22.3906px;\">Feb- 8 leaves</td>\r\n<td style=\"width: 50%; height: 22.3906px;\">August - 8 Leaves</td>\r\n</tr>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"width: 50%; height: 22.3906px;\">March - 7 leaves</td>\r\n<td style=\"width: 50%; height: 22.3906px;\">Sept - 7 Leaves</td>\r\n</tr>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"width: 50%; height: 22.3906px;\">April-5 leaves</td>\r\n<td style=\"width: 50%; height: 22.3906px;\">Oct - 6 Leaves</td>\r\n</tr>\r\n<tr style=\"height: 92.7812px;\">\r\n<td style=\"width: 50%; height: 92.7812px;\">\r\n<p>May - 3 leaves</p>\r\n<p>June -1 leaves</p>\r\n</td>\r\n<td style=\"width: 50%; height: 92.7812px;\">\r\n<p>Nov - 4 Leaves</p>\r\n<p>Dec - 2 Leaves</p>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"width: 50%; height: 22.3906px;\">&nbsp;</td>\r\n<td style=\"width: 50%; height: 22.3906px;\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>Sandwich Leave Policy:</strong></p>\r\n<p>Sandwich leave policy implies that&rsquo;s the otherwise termed holidays (Saturday and Sunday or week offs) falling between two availed leaves would get merged and categorised as leaves.</p>\r\n<p>For example.</p>\r\n<p>If you are on leave on<strong>&nbsp;Friday</strong>&nbsp;and you will take an additional leave on<strong>&nbsp;Monday</strong>,&nbsp;<strong>you will consume all the days from your leave balance including Saturday &amp; Sunday&nbsp;</strong>as opposed to the days you actually applied.</p>\r\n<p><span style=\"font-family: Tahoma;\">&nbsp;<strong>Festive holiday policy (based on calendar years)</strong></span></p>\r\n<p><span style=\"font-family: Tahoma;\">Whenever there is a festive holiday in the middle of the week, if trainees take any leave on any working day in between the federal holiday and weekends, it will be considered as LOP (loss of pay) for the trainees for all the days including federal holidays and weekends.</span></p>\r\n<p><span style=\"font-family: Tahoma;\">For all the permanent employees, it is mandatory to apply for a leave 15 days in advance if they are planning to apply for a leave on a day which is between a federal holiday and weekends. The approval of leaves for permanent employees will be based on the managers decision and the project criticality.&nbsp; <br /></span></p>\r\n<p><span style=\"font-family: Tahoma;\">Employee attendance will be based on the HR soft until the bio-metric is configured with the new software.</span></p>\r\n<p><span style=\"font-family: Tahoma;\">Half-day to be allowed for permanent employees based on managers decision, which can be a maximum of 2 in a month. &nbsp; &nbsp; <br /></span></p>\r\n<p><span style=\"font-family: Tahoma;\">Trainees can take a leave of 2 days in a span of 6 months based on the decision of manager<br /></span></p>\r\n<p><span style=\"font-family: Tahoma;\">Lunch time is fixed, however, employees can take a small break and have their food whenever they are hungry before lunch</span></p>', '2024-05-10 23:52:30', '2025-01-23 00:16:30'),
(32, 'Business Promotion', '<p>Expenses incurred by the employee during business projects should be duly approved by the management of the company at the discretion of the management.</p>', '2024-05-10 23:54:04', '2024-05-10 23:54:26'),
(33, 'Medical', '<p>Your appointment shall be subject to your being declared physically fit. Even thereafter, in case it is considered essential, you shall have to undergo periodical or special medical examination from such a doctor as may be nominated by the company for the purpose of determining whether or not you are medically capable of carrying out your duties and if you are found medically unfit your services are liable to be terminated without any notice &amp; benefits etc.</p>', '2024-05-10 23:54:43', '2024-05-10 23:55:37'),
(34, 'Exit and Full and Final Settlement', '<p>If any employee wishes to resign from his roles and responsibilities within the organization they should inform their reporting manager in advance and then submit their resignation online. The details shall be further shared with the Human Resource department, post which the employee would have a one on one discussion with the Human Resource manager before the LWD details are uploaded on the Vconnect portal.</p>\r\n<p>A permanent employee must serve&nbsp;<strong>60 days of Notice Period</strong>&nbsp;to be eligible for the full and final settlement. In exceptional cases, if the employee&nbsp; is in need of early relieving and can serve&nbsp;<strong>only 30 days</strong>, they have the option to buyout the notice period by forgoing the salary of 1 month.&nbsp; &nbsp;</p>\r\n<p>A trainee must serve 30 days of notice period to be eligible for any financial settlements (If applicable).</p>\r\n<p>The employee must return all the company assets to Human Resource/ Administration Department. Once the above mentioned formalities are complete, the finance team would start working on their full and final settlement.</p>', '2024-05-10 23:56:22', '2024-05-10 23:58:57');
